import React from 'react';

function Heading () {
    return (
        <>
            <Video></Video>
            <CalcBody>
                <Inputs></Inputs>
                <Buttons></Buttons>
            </CalcBody>
        </>
    )
}

function Video () {
    return (
        <>
        <video style={vid} autoPlay loop muted>
            <source src="video.mp4" type="video/mp4"></source>
        </video>
        </>
    )
}

function CalcBody () {
    return (
        <>
        <div className="blur"></div>
        </>
    )
}

function Inputs () {
    return (
        <input style="inp" type="text"></input>
    )
}

function Buttons () {
    return (
        <>
        <button></button>
        </>
    )
}

const vid = {
    width : '100%',
    // height : '100vh',
    position : 'absolute',
    top : '0',
    left : '0',
    overflow : 'hidden',
    zIndex : '1'
}

const inp = {
    width: '400px',
    height : '30px',
    backgroundColor : 'white',
}

export default Heading;
